def is_valid_ipv4_address(ip_str):
    try:
        ip = ipaddress.ip_interface(ip_str)
        if ip.version == 4:
            if ip.is_global:
                return 'Global Unicast'
            elif ip.is_private:
                return 'Private Use'
            elif ip.is_reserved:
                return 'Reserved'
            elif ip.is_multicast:
                return 'Multicast'
            else:
                return 'Unknown'
    except ValueError:
        pass
    return True

